webpackJsonp([0x98543f470c00],{672:function(a,n){a.exports={data:{markdownRemark:{html:'<p>You can add your HackerOne calendar to your own personal calendar. By syncing your calendar, you can easily keep track of the:</p>\n<ul>\n<li>Date you joined HackerOne</li>\n<li>HackerOne Challenge dates you\'re invited to</li>\n</ul>\n<p>You can sync your HackerOne calendar with your personal calendar on Google calendar and Apple calendar.</p>\n<p>To add your HackerOne calendar to your personal calendar:</p>\n<ol>\n<li>Go to your profile <strong>Settings > Calendar</strong>.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-b80d0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.426614481409004%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Calendar Preferences"\n        title=""\n        src="/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-2f183.png"\n        srcset="/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-67829.png 125w,\n/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-5c59f.png 250w,\n/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-2f183.png 500w,\n/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-c93e8.png 750w,\n/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-4e628.png 1000w,\n/static/hacker-calendar-1-fa8fba65847bbf10577a158bf24d29a6-b80d0.png 1022w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="2">\n<li>Click <strong>Generate</strong> to generate your personal calendar URL.</li>\n<li>Click <strong>Copy</strong> to copy the URL.</li>\n<li>Import your HackerOne calendar URL to your personal calendar in <a href="#iCal">iCal</a> or <a href="#Google">Google Calendar</a>.</li>\n</ol>\n<p>You can choose to regenerate your calendar URL by clicking <strong>Regenerate</strong>. Keep in mind that if you regenerate your URL, it\'ll disable your calendar settings with the old URL.</p>\n<h3 id="iCal">Importing to iCal</h3>\n<ol>\n<li>Go to <strong>File > New Calendar Subscription</strong> in Calendar.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-bebc0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.203125%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="iCal url input"\n        title=""\n        src="/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-2f183.png"\n        srcset="/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-67829.png 125w,\n/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-5c59f.png 250w,\n/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-2f183.png 500w,\n/static/hacker-calendar-2-28a8f4a20274d6eb9f1e28b2f8760db8-bebc0.png 512w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="2">\n<li>Enter your HackerOne calendar URL and click <strong>Subscribe</strong>.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-bebc0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 68.9453125%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="iCal URL settings"\n        title=""\n        src="/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-2f183.png"\n        srcset="/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-67829.png 125w,\n/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-5c59f.png 250w,\n/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-2f183.png 500w,\n/static/hacker-calendar-3-52fb888d6b56520c31785da815befdc7-bebc0.png 512w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="3">\n<li>Enter a name for your calendar and choose a color to help you identify it on your calendar.</li>\n<li>Choose how frequently you want to refresh the events in the <strong>Auto Refresh</strong> field.</li>\n<li>Click <strong>OK</strong>.</li>\n</ol>\n<h3 id="Google">Importing to Google Calendar</h3>\n<ol>\n<li>Open <a href="https://calendar.google.com/">Google Calendar</a>.</li>\n<li>Add a new calendar by selecting <strong>From URL</strong>.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker-calendar-4-3bc76fbd71643f623a9aece15921a25f-060a2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 478px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.18828451882845%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="google calendar add calendar"\n        title=""\n        src="/static/hacker-calendar-4-3bc76fbd71643f623a9aece15921a25f-060a2.png"\n        srcset="/static/hacker-calendar-4-3bc76fbd71643f623a9aece15921a25f-764d5.png 125w,\n/static/hacker-calendar-4-3bc76fbd71643f623a9aece15921a25f-82f02.png 250w,\n/static/hacker-calendar-4-3bc76fbd71643f623a9aece15921a25f-060a2.png 478w"\n        sizes="(max-width: 478px) 100vw, 478px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="3">\n<li>Enter your HackerOne calendar URL.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-5c679.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 52.455795677799614%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="google cal adding URL"\n        title=""\n        src="/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-2f183.png"\n        srcset="/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-67829.png 125w,\n/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-5c59f.png 250w,\n/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-2f183.png 500w,\n/static/hacker-calendar-5-ad3ab2823bc7ce52df72b43764171854-5c679.png 509w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="4">\n<li>Click <strong>Add Calendar</strong>.</li>\n<li><em>(Optional)</em> Go to <strong>Settings</strong> in your Google Calendar.</li>\n<li><em>(Optional)</em> Select the HackerOne calendar and enter a name for it. You can also choose a color to help you better identify it on your calendar.</li>\n</ol>',frontmatter:{title:"Hacker Calendar",id:"hackers/calendar",path:"/hackers/calendar.html",description:null}}},pathContext:{}}}});
